import styled from 'styled-components'


export default styled.div`
grid-area: DC;
display: flex;
/* align-items: center; */
/* border: solid 1px gray; */
/* background-color: var(--senary); */
div{
margin-top:10px;
  margin-right:30px;
}
div#privateDocs{
  display: flex;
flex-direction: column;
}



`
